import React from "react";
import Logo from "../assets/logo.png";

const headerLinks = [
  { label: "Home", url: "/" },
  { label: "About", url: "/about" },
  { label: "Service", url: "/service" },
  { label: "Products", url: "/products" },
  { label: "Contact", url: "/contact" },
];

function Header() {
  return (
    <header>
      <img src={Logo} height={60} />
      <div>
        <ul>
          <li></li>
        </ul>
      </div>
    </header>
  );
}

export default Header;
